import React from 'react';
import "../styles/ImpactScore.css";
import { BarChart } from '@mui/x-charts/BarChart';


function ImpactScore() {
  return (
    <div className='impactScore'>
      <div className='chart'>
        <BarChart
            // ...
            xAxis={[
              {
                scaleType: 'band',
                data: ['GES', 'EAU'],
                categoryGapRatio: 0.2,
                barGapRatio: 0.3
              }
            ]}
          />
      </div>
      <div className='texte'>

      </div>
    </div>
  )
}

export default ImpactScore
